// src/pages/ShiftChecklist.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";
import { useAuth } from "../context/AuthContext";
import TopBar from "../components/TopBar";
import dayjs from "dayjs";

function ShiftChecklist() {
  const { user } = useAuth();
  const [building, setBuilding] = useState("");
  const [items, setItems] = useState([]);
  const [checkedItems, setCheckedItems] = useState([]);
  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    if (building) {
      fetchItems();
    }
  }, [building]);

  const fetchItems = async () => {
    try {
      const res = await axios.get("/api/items", {
        params: {
          building,
          status: "Available"
        }
      });
      setItems(res.data);
    } catch (err) {
      console.error("Failed to fetch items:", err);
    }
  };

  const handleCheck = (barcode) => {
    setCheckedItems((prev) =>
      prev.includes(barcode)
        ? prev.filter((b) => b !== barcode)
        : [...prev, barcode]
    );
  };

  const handleSubmit = async () => {
    const missingItems = items
      .map((item) => item.barcode)
      .filter((b) => !checkedItems.includes(b));

    const payload = {
      user: user.name,
      building,
      time: new Date().toISOString(),
      confirmed: true,
      presentItems: checkedItems,
      missingItems: missingItems
    };

    try {
        await axios.post("/api/inventory-checks", payload, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        });
        setSubmitted(true);
      } catch (err) {
        console.error("Failed to submit checklist:", err);
      }

  };

  return (
    <>
      <TopBar />
      <div className="p-6 min-h-screen bg-gray-900 text-white">
        <h2 className="text-3xl font-bold mb-6 text-center text-asuGold">
          Equipment Check
        </h2>

        {!building && (
          <div className="max-w-md mx-auto mb-10">
            <label className="block mb-2 text-sm">Select Building:</label>
            <select
              className="w-full bg-gray-800 text-white p-3 rounded"
              value={building}
              onChange={(e) => setBuilding(e.target.value)}
            >
              <option value="">-- Choose Building --</option>
              <option value="Memorial Union">Memorial Union</option>
              <option value="Student Pavilion">Student Pavilion</option>
            </select>
          </div>
        )}

        {building && !submitted && (
          <>
            <div className="mb-6">
              <h3 className="text-xl font-semibold mb-3">
                Verified Items ({checkedItems.length} / {items.length})
              </h3>
              <ul className="space-y-3">
                {items.map((item) => (
                  <li
                    key={item.barcode}
                    className="flex items-center gap-4 bg-gray-800 p-3 rounded"
                  >
                    <input
                      type="checkbox"
                      checked={checkedItems.includes(item.barcode)}
                      onChange={() => handleCheck(item.barcode)}
                    />
                    <span className="text-sm font-mono text-white">
                      {item.name} â€” #{item.barcode}
                    </span>
                  </li>
                ))}
              </ul>
            </div>
            <div className="text-center">
              <p className="text-sm mb-4 text-gray-300">
                I confirm that the checked items are present in the closet.
              </p>
              <button
                onClick={handleSubmit}
                className="bg-green-600 hover:bg-green-700 px-6 py-3 rounded-lg font-semibold text-white"
              >
                Submit Checklist
              </button>
            </div>
          </>
        )}

        {submitted && (
          <div className="text-center mt-10">
            <h3 className="text-2xl font-bold text-green-500 mb-2">
              Checklist Submitted!
            </h3>
            <p className="text-sm text-gray-300">
              Logged at {dayjs().format("MMM D, YYYY h:mm A")} by {user.name}.
            </p>
          </div>
        )}
      </div>
    </>
  );
}

export default ShiftChecklist;
